import React from 'react'

function pageImg(props) {
    
    const {img,text,buttonClass,buttonName} = props.values;

    const background = {
        background : `url(${img})`,  
        backgroundSize: "cover",
        backgroundPosition:"center bottom"
    }

    return (
        <div style={background} className="pageImg">
            <div className="pageImgInfo">
                <p>{text}</p>
                <button className={buttonClass}>{buttonName}</button>
            </div>
        </div>
    )
}

export default pageImg;
